  // json 파일 데이터 저장
  async postVitamin() {
    try {
      const jsonFile = fs.readFileSync('drug-with-prd.json', 'utf8');
      const jsonData: {
        ENTRPS: string; //ENTRPS
        PRDUCT: string; //PRDUCT
        STTEMNT_NO: string; // STTEMNT_NO
        REGIST_DT: string; // REGIST_DT
        DISTB_PD: string; // DISTB_PD
        SUNGSANG: string; // SUNGSANG
        SRV_USE: string; // SRV_USE
        PRSRV_PD: string; // PRSRV_PD
        INTAKE_HINT1: string; // INTAKE_HINT1
        MAIN_FNCTN: string; //MAIN_FNCTN
        BASE_STANDARD: string; // BASE_STANDARD
      }[] = JSON.parse(jsonFile);

      await Promise.all([
        jsonData.forEach((e, i) => {
          const data = {
            ENTRPS: e.ENTRPS,
            PRDUCT: e.PRDUCT,
            STTEMNT_NO: e.STTEMNT_NO,
            REGIST_DT: e.REGIST_DT,
            DISTB_PD: e.DISTB_PD,
            SUNGSANG: e.SUNGSANG,
            SRV_USE: e.SRV_USE,
            PRSRV_PD: e.PRSRV_PD,
            INTAKE_HINT1: e.INTAKE_HINT1,
            MAIN_FNCTN: e.MAIN_FNCTN,
            BASE_STANDARD: e.BASE_STANDARD,
          };

          this.VtestRepository.save(data);
        }),
      ]);

      return '데이터를 저장했습니다.';
    } catch (e) {
      console.log(e);
    }
  }

